use geom;
drop table if exists poly800;
create table poly800(id int not null PRIMARY KEY,geom geography);
SET QUOTED_IDENTIFIER ON;
CREATE SPATIAL INDEX idx_poly800 ON poly800(geom) USING GEOGRAPHY_GRID WITH(GRIDS = (LEVEL_1 = MEDIUM, LEVEL_2 = MEDIUM, LEVEL_3 = MEDIUM, LEVEL_4 = MEDIUM), CELLS_PER_OBJECT = 16);
